`)]),s("div",{class:"line-numbers","aria-hidden":"true"},[s("div",{class:"line-number"})])],-1),es=i('<h3 id="前序、中序、后序遍历" tabindex="-1"><a class="header-anchor" href="#前序、中序、后序遍历" aria-hidden="true">#</a> 前序、中序、后序遍历</h3><p>相对地，前、中、后序遍历皆属于「深度优先遍历 Depth-First Traversal」，即每次搜索会直接搜索到叶子结点，然后再回溯去搜索其他的结点。</p><p>如下图所示，左侧是深度优先遍历的的示意图，右上方是对应的递归实现代码。深度优先遍历就像是绕着整个二叉树的外围“走”一圈，走的过程中，在每个结点都会遇到三个位置(即是向下继续搜索左子结点、右子结点或是回溯到父结点)，分别对应前序遍历、中序遍历、后序遍历。</p><p><img src="'+f+'" alt="前序,中序,后序遍历" loading="lazy"></p><table><thead><tr><th style="text-align:center;">位置</th><th style="text-align:center;">含义</th><th style="text-align:center;">此处访问结点时对应</th></tr></thead><tbody><tr><td style="text-align:center;">橙色圆圈处</td><td style="text-align:center;">刚进入此节点，即将访问该结点的左子树</td><td style="text-align:center;">前序遍历 Pre-Order Traversal</td></tr><tr><td style="text-align:center;">蓝色圆圈处</td><td style="text-align:center;">已访问完左子树，即将访问右子树</td><td style="text-align:center;">中序遍历 In-Order Traversal</td></tr><tr><td style="text-align:center;">紫色圆圈处</td><td style="text-align:center;">已访问完左子树和右子树，即将返回</td><td style="text-align:center;">后序遍历 Post-Order Traversal</td></tr></tbody></table><h4 id="由遍历序列确认二叉树" tabindex="-1"><a class="header-anchor" href="#由遍历序列确认二叉树" aria-hidden="true">#</a> 由遍历序列确认二叉树</h4><ul><li>前序 / 后序遍历和中序遍历可以唯一确定一颗二叉树</li><li>前序遍历和后序遍历<strong>不能</strong>唯一确定一颗二叉树</li></ul><p><img src="'+z+'" alt="前序,中序,后序遍历" loading="lazy"></p><p>【求解一颗二叉树某一遍历顺序序列】</p><p>这三种序列都是从根节点开始的深搜序列，根据其选择的优先级顺序，例如前序遍历为 <code>(根,左,右)</code> (这是根，左，右是相对而言的，不是整颗树的)，思考过程如下：</p><ol><li>首先是到 <code>A</code> (根)结点，是 “根” ，入序列，然后根据 <code>(根,左,右)</code> 原则遍历该 “根结点” 的 “左” 结点，</li><li>来到左节点 <code>B</code> , 是 “左” ，入序列，因为是深度优先，所以继续根据 <code>(根,左,右)</code> 原则向下遍历以 <code>B</code> 为 “根” 的子树，直至以 <code>B</code> 为 “根” 的子树遍历完毕，</li><li>对于 <code>A</code> (根)结点来说，<code>(根,左)</code> 已经遍历完毕，然后继续遍历 “右” ，即来到 <code>E</code> ,是 “右” ，入序列，然后继续前序遍历原则直接所有结点遍历结束.</li></ol><p>【根据前序 / 后序遍历和中序遍历唯一确定一颗二叉树】</p><p><img src="'+L+'" alt="image-20221227191400186" loading="lazy"></p>',13),is=s("div",{class:"language-text line-numbers-mode","data-ext":"text"},[s("pre",{class:"language-text"},[s("code",null,`
